function Favourites(){
    let elems=[]
    let newelems=[];
    for(let session in sessionStorage){
    
    
        elems.push(sessionStorage.getItem([session]))
        for(let i of elems){
            if (i==null){
                elems.splice( elems.indexOf(i))
            }
            else{
                for(let r in JSON.parse(i)){
                    elems[elems.indexOf(r)]=(JSON.parse(i)[r])
                }
                }
           
               
        }
    }
    console.log(elems)
    return <div>{newelems}</div>
    }
    export default Favourites;
